{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/olgaluzhetska/bellabeat-case-study-r-notebook?scriptVersionId=99872466\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"attachments":{"ea751380-85c8-47e4-9d6c-9a839266484d.jpg":{"image/jpeg":""}},"cell_type":"markdown","id":"b3efa313","metadata":{"papermill":{"duration":0.084965,"end_time":"2022-07-02T20:18:26.759188","exception":false,"start_time":"2022-07-02T20:18:26.674223","status":"completed"},"tags":[]},"source":["## Introduction\n","#### About Company\n","Bellabeat is a tech-driven wellness company for women. It produces stylish smart devices, which collect data on activity, sleep, stress, and reproductive health, empowering women with knowledge about their own health and habits.\n","The company was established by Urka Sren and Sando Mur.\n","\n","![devices-corporate.jpg](attachment:ea751380-85c8-47e4-9d6c-9a839266484d.jpg)\n","\n","#### Business Task\n","\n","To provide recommendations on improvement of Bellabeat marketing strategy based on analysis of non-Bellabeat smart device usage data and application of the insights to one Bellabeat product.\n","\n","#### Questions To Answer\n","\n","*     What are some trends in smart device usage?\n","*     How could these trends apply to Bellabeat customers?\n","*     How could these trends help influence Bellabeat marketing strategy?\n","\n","\n"]},{"cell_type":"markdown","id":"ca755843","metadata":{"papermill":{"duration":0.081781,"end_time":"2022-07-02T20:18:26.922938","exception":false,"start_time":"2022-07-02T20:18:26.841157","status":"completed"},"tags":[]},"source":["## Data Sources\n","For this case study, Kaggle data set [FitBit Fitness Tracker Data](https://www.kaggle.com/arashnic/fitbit) (CC0: Public Domain, dataset made available through [Mobius](https://www.kaggle.com/arashnic)) has been used.  \n","\n","Thirty eligible Fitbit users consented to the submission of personal tracker data, including minute-level output for physical activity, heart rate, and sleep monitoring. The dataset includes information about daily activity, steps, and heart rate that can be used to explore users habits.  \n","\n","#### Tools and Instruments\n","\n","This Kaggle R Notebook is the main tool used for cleaning, preprocessing and analysing data. Additionally, data was downloaded and imported to Google Sheets for a quick preview.  \n","\n","#### Data Structure and Organization\n","\n","The dataset consists of 18 csv files in total, 15 of them in long format and 3 in wide format.  \n","The data is collected within different timeframes (second, minute, hour, day) and focuses on multiple characterisctics: activity, sleep, weight, MET, calories intake, heartrate etc.\n","\n","The following inconsistencies are noticed:  \n","\n","**Size:**\n","* file **heartrate_seconds_merged.csv** is too large for upload to Google Sheets  \n","\n","**Naming:**\n","* the name for **weightLogInfo_merged.csv** does not provide clear information about the timeframe;\n","* the names for **sleepDay_merged.csv** and **heartrate_seconds_merged.csv** are inconsistent either: timeframe info does not come first, as for other files;\n","* all file names contain word *merged*, which is redundant therefore and can be removed;\n","* while some files have markers *Wide* and *Narrow* in their names, others don't.\n","    \n","   \n","\n","\n","#### Selecting Input Files\n","In my analysis, I will concentrate on **daily activity** data, **weight** and **sleep** data. Daily activity data contains information from many other files, which can be therefore skipped. Sleep and weight files, on the otehr hand, contain unique and compact data and can be nicely combined with other files. I would like to use also heartrate data, but unfortunately it slows up the system too much."]},{"cell_type":"markdown","id":"45e19e8a","metadata":{"papermill":{"duration":0.082259,"end_time":"2022-07-02T20:18:27.088223","exception":false,"start_time":"2022-07-02T20:18:27.005964","status":"completed"},"tags":[]},"source":["## Cleaning Data"]},{"cell_type":"code","execution_count":1,"id":"898f4696","metadata":{"execution":{"iopub.execute_input":"2022-07-02T20:18:27.267767Z","iopub.status.busy":"2022-07-02T20:18:27.264069Z","iopub.status.idle":"2022-07-02T20:18:28.767167Z","shell.execute_reply":"2022-07-02T20:18:28.765845Z"},"papermill":{"duration":1.594823,"end_time":"2022-07-02T20:18:28.767401","exception":false,"start_time":"2022-07-02T20:18:27.172578","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":[" \u001b[1mAttaching packages\u001b[22m  tidyverse 1.3.1 \n","\n","\u001b[32m\u001b[39m \u001b[34mggplot2\u001b[39m 3.3.5     \u001b[32m\u001b[39m \u001b[34mpurrr  \u001b[39m 0.3.4\n","\u001b[32m\u001b[39m \u001b[34mtibble \u001b[39m 3.1.5     \u001b[32m\u001b[39m \u001b[34mdplyr  \u001b[39m 1.0.7\n","\u001b[32m\u001b[39m \u001b[34mtidyr  \u001b[39m 1.1.4     \u001b[32m\u001b[39m \u001b[34mstringr\u001b[39m 1.4.0\n","\u001b[32m\u001b[39m \u001b[34mreadr  \u001b[39m 2.0.2     \u001b[32m\u001b[39m \u001b[34mforcats\u001b[39m 0.5.1\n","\n"," \u001b[1mConflicts\u001b[22m  tidyverse_conflicts() \n","\u001b[31m\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mfilter()\u001b[39m masks \u001b[34mstats\u001b[39m::filter()\n","\u001b[31m\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mlag()\u001b[39m    masks \u001b[34mstats\u001b[39m::lag()\n","\n","\n","Attaching package: lubridate\n","\n","\n","The following objects are masked from package:base:\n","\n","    date, intersect, setdiff, union\n","\n","\n"]}],"source":["# Import the required libraries:\n","\n","library(tidyverse)\n","library(lubridate)\n","library(dplyr)\n","library(ggplot2)"]},{"cell_type":"code","execution_count":2,"id":"e65e955c","metadata":{"execution":{"iopub.execute_input":"2022-07-02T20: