ition** in their marketing campains.\n","* Analysis shows that users with higher weight tend to move more, and there is no dependency between BMI and activity. This insight is an important basis for **promoting physical activity among everyone**; again, women tend to think that they can not go to the gym due to being overweight, or that they will look not beutiful enough in sports clothes. Bellabeat could show models of every body constitution in marketing campaigns to give a nice example for women and especially young girls, who are very sensitive to such things.\n","\n","\n","\n","![bruno-nascimento-PHIgYUGQPvU-unsplash.jpg](attachment:847dd75f-99bb-4693-925a-b9983e451141.jpg)"]},{"cell_type":"markdown","id":"c01fa0fb","metadata":{"papermill":{"duration":0.162028,"end_time":"2022-07-02T20:18:39.871087","exception":false,"start_time":"2022-07-02T20:18:39.709059","status":"completed"},"tags":[]},"source":["### References and Links\n","1. <a href=\"https://bellabeat.com/wp-content/uploads/2021/10/devices-corporate.jpg\">Photo</a> from Bellabeat official website\n","\n","2. https://en.wikipedia.org/wiki/Human_body_weight\n","  \n","3. https://unsplash.com/photos/PHIgYUGQPvU Photo by <a href=\"https://unsplash.com/@bruno_nascimento?utm_source=unsplash&utm_medium=referral&utm_content=creditCopyText\">Bruno Nascimento</a> on <a href=\"https://unsplash.com/s/photos/fitness?utm_source=unsplash&utm_medium=referral&utm_content=creditCopyText\">Unsplash</a>\n","  "]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":17.221378,"end_time":"2022-07-02T20:18:40.151867","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2022-07-02T20:18:22.930489","version":"2.3.3"}},"nbformat":4,"